import logo from './logo.svg';
import { Routes, Route } from 'react-router-dom';
import Welcome from './screens/wecome';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Welcome />} />
      </Routes>
    </div>
  );
}

export default App;
